import * as t from "./types";

export function buttonReducer(action) {
  switch (action.type) {
    case t.DID:{
        console.log("did");
      }
      break;
    case t.CANCELED:{
        console.log("canceled");
      }
      break;
    case t.CLOSED:{
        console.log("closed");
      }
      break;
    default:
      return;
  }
}
